import React, { useState } from "react"
import styled from "styled-components"
import FILE1 from "../components/files/file1"
import FILE2 from "../components/files/file2"
import FILE3 from "../components/files/file3"
import FILE4 from "../components/files/file4"
import FILE5 from "../components/files/file5"
import FILE6 from "../components/files/file6"
import FILE7 from "../components/files/file7"
import FILE8 from "../components/files/file8"
import FILE9 from "../components/files/file9"
import FILE10 from "../components/files/file10"

const Ul = styled.ul`
  display: flex;
  align-items: center;
  justify-content: center;
`
const Li = styled.li`
  list-style: none;
  width: 40px;
  height: 40px;
  text-align: center;
  line-height: 40px;
  border-radius: 50%;
  background-color: red;
  margin: 0 10px;
  cursor: pointer;
  &:hover {
    background-color: aqua;
    color: red;
    font-size: 18px;
  }
`
const API = [
  {
    page: 1,
  },
  {
    page: 2,
  },
  {
    page: 3,
  },
  {
    page: 4,
  },
  {
    page: 5,
  },
  {
    page: 6,
  },
  {
    page: 7,
  },
  {
    page: 8,
  },
  {
    page: 9,
  },
  {
    page: 10,
  },
]
const Home = () => {
  const [page, setPage] = useState(1)
  console.log(page)
  return (
    <div>
      <div>
        <Ul>
          {API.map((item) => (
            <Li key={item.page} onClick={() => setPage(item.page)}>
              {item.page}
            </Li>
          ))}
        </Ul>
      </div>
      <table border={1}>
        <tr>
          <th>ID voice</th>
          <th>ID Agent</th>
          <th>ID Customer</th>
          <th>date</th>
          <th>call hold duration</th>
          <th>call duration</th>
        </tr>
        {page === 1 &&
          FILE1.map((item) => (
            <tr key={item.voice_id}>
              <th>{item.voice_id}</th>
              <td>{item.audioCredit.agent.callPhone[0].agentID}</td>
            </tr>
          ))}
        {page === 2 &&
          FILE2.map((item) => (
            <tr key={item.voice_id}>
              <th>{item.voice_id}</th>
              <td>{item.audioCredit.callDuration}</td>
            </tr>
          ))}
        {page === 3 &&
          FILE3.map((item) => (
            <tr key={item.voice_id}>
              <th>{item.voice_id}</th>
              <td>{item.audioCredit.callDuration}</td>
            </tr>
          ))}
        {page === 4 &&
          FILE4.map((item) => (
            <tr key={item.voice_id}>
              <th>{item.voice_id}</th>
              <td>{item.audioCredit.callDuration}</td>
            </tr>
          ))}
        {page === 5 &&
          FILE5.map((item) => (
            <tr key={item.voice_id}>
              <th>{item.voice_id}</th>
              <td>{item.audioCredit.callDuration}</td>
            </tr>
          ))}
        {page === 6 &&
          FILE6.map((item) => (
            <tr key={item.voice_id}>
              <th>{item.voice_id}</th>
              <td>{item.audioCredit.callDuration}</td>
            </tr>
          ))}
      </table>
    </div>
  )
}

export default Home
